li&gt;\n&lt;li&gt; deserialize time: 61.75 ms &lt;/li&gt;\n&lt;li&gt; transfer time: 65.98 s &lt;/li&gt;\n        &lt;/ul&gt;\n\n        &lt;h2&gt; Scheduler Information &lt;/h2&gt;\n        &lt;ul&gt;\n          &lt;li&gt; Address: tcp://127.0.0.1:44769 &lt;/li&gt;\n          &lt;li&gt; Workers: 2 &lt;/li&gt;\n          &lt;li&gt; Threads: 8 &lt;/li&gt;\n          &lt;li&gt; Memory: 16.64 GB &lt;/li&gt;\n          &lt;li&gt; Dask Version: 2021.01.1 &lt;/li&gt;\n          &lt;li&gt; Dask.Distributed Version: 2021.01.1 &lt;/li&gt;\n        &lt;/ul&gt;\n\n        &lt;h2&gt; Calling Code &lt;/h2&gt;\n        &lt;pre&gt;\ndef run_scene_optimizer() -&gt; None:\n    \"\"\" \"\"\"\n    with initialize_config_module(config_module=\"gtsfm.configs\"):\n        # config is relative to the gtsfm module\n        cfg = compose(config_name=\"default_lund_door_set1_config.yaml\")\n        scene_optimizer: SceneOptimizer = instantiate(cfg.SceneOptimizer)\n\n        loader = OlssonLoader(os.path.join(DATA_ROOT, \"set1_lund_door\"), image_extension=\"JPG\")\n\n        sfm_result_graph = scene_optimizer.create_computation_graph(\n            len(loader),\n            loader.get_valid_pairs(),\n            loader.create_computation_graph_for_images(),\n            loader.create_computation_graph_for_intrinsics(),\n            use_intrinsics_in_verification=True,\n            gt_pose_graph=loader.create_computation_graph_for_poses(),\n        )\n\n        # create dask client\n        cluster = LocalCluster(n_workers=2, threads_per_worker=4)\n\n        with Client(cluster), performance_report(filename=\"dask-report.html\"):\n            sfm_result = sfm_result_graph.compute()\n\n        assert isinstance(sfm_result, GtsfmData)\n\n        # ===== densify =====\n        #   step 1: form image dict\n        img_dict = dict()\n        for i in range(len(loader)):\n            img_dict[i] = loader.get_image(i)\n        #   step 2: call densify\n        mvsnet = MVSNets()\n        dense_points = mvsnet.densify(images=img_dict, sfm_result=sfm_result)\n\n        print(f\"Output dense point cloud volume:{dense_points.shape}\")\n\n        &lt;/pre&gt;\n        "},"id":"1210","type":"Div"},{"attributes":{"fill_alpha":{"value":0.1},"fill_color":{"field":"bandwidth","transform":{"id":"1146"}},"height":{"units":"data","value":1},"line_alpha":{"value":0.1},"line_color":{"field":"bandwidth","transform":{"id":"1146"}},"width":{"units":"data","value":1},"x":{"field":"source"},"y":{"field":"destination"}},"id":"1167","type":"Rect"},{"attributes":{"data_source":{"id":"1145"},"glyph":{"id":"1166"},"hover_glyph":null,"muted_glyph":null,"nonselection_glyph":{"id":"1167"},"selection_glyph":null,"view":{"id":"1169"}},"id":"1168","type":"GlyphRenderer"},{"attributes":{"high":542633580.6077639,"low":0,"palette":["#ffffFF","#fefeFF","#fdfdFF","#fcfcFF","#fbfbFF","#fafaFF","#f9f9FF","#f8f8FF","#f7f7FF","#f6f6FF","#f5f5FF","#f4f4FF","#f3f3FF","#f2f2FF","#f1f1FF","#f0f0FF","#efefFF","#eeeeFF","#ededFF","#ececFF","#ebebFF","#eaeaFF","#e9e9FF","#e8e8FF","#e7e7FF","#e6e6FF","#e5e5FF","#e4e4FF","#e3e3FF","#e2e2FF","#e1e1FF","#e0e0FF","#dfdfFF","#dedeFF","#ddddFF","#dcdcFF","#dbdbFF","#dadaFF","#d9d9FF","#d8d8FF","#d7d7FF","#d6d6FF","#d5d5FF","#d4d4FF","#d3d3FF","#d2d2FF","#d1d1FF","#d0d0FF","#cfcfFF","#ceceFF","#cdcdFF","#ccccFF","#cbcbFF","#cacaFF","#c9c9FF","#c8c8FF","#c7c7FF","#c6c6FF","#c5c5FF","#c4c4FF","#c3c3FF","#c2c2FF","#c1c1FF","#c0c0FF","#bfbfFF","#bebeFF","#bdbdFF","#bcbcFF","#bbbbFF","#babaFF","#b9b9FF","#b8b8FF","#b7b7FF","#b6b6FF","#b5b5FF","#b4b4FF","#b3b3FF","#b2b2FF","#b1b1FF","#b0b0FF","#afafFF","#aeaeFF","#adadFF","#acacFF","#ababFF","#aaaaFF","#a9a9FF","#a8a8FF","#a7a7FF","#a6a6FF","#a5a5FF","#a4a4FF","#a3a3FF","#a2a2FF","#a1a1FF","#a0a0FF","#9f9fFF","#9e9eFF","#9d9dFF","#9c9cFF","#9b9bFF","#9a9aFF","#9999FF","#9898FF","#9797FF","#9696FF","#9595FF","#9494FF","#9393FF","#9292FF","#9191FF","#9090FF","#8f8fFF","#8e8eFF","#8d8dFF","#8c8cFF","#8b8bFF","#8a8aFF","#898
